import React from 'react'
import { Route, Link } from 'react-router-dom'

function Links() {
    return (
        <div>
            <h1>Links</h1>

            <p>
                <Link to='/home'>Home</Link>
                <Link to='/about'>About</Link>
                <Link to='/navigation'>Navigation</Link>
            </p>

        </div>
    )
}

export default Links;
